    [],nt"num_tags": 1,nt"name": "fort-niobrara-national-wildlife-refuge-january-1-1943-april-30-1943",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Fort Niobrara
    National Wildlife Refuge outlines Refuge accomplishments from January through April
    of 1943. The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
    and fish- is also covered. The Refuge development and maintenance section discusses
    physical developments and plantings. Resource management is outlined; topics include
    fur harvesting and timber removal. The public relations section of the report describes
    recreational uses, Refuge visitors, and Refuge participation. N-R forms and photographs
    are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
